{
    "alias": "satis.phar",
    "main": "bin/satis",
    "output": "satis.phar",
    "stub": true,
    "directories": ["src", "views"],
    "files": ["LICENSE", "res/satis-schema.json"],
    "finder": [
        {
            "name": "*.php",
            "in": "vendor"
        },
        {
            "name": "completion.*",
            "in": "vendor/symfony/console/Resources"
        },
        {
            "name": "composer-schema.json",
            "in": "vendor/composer/composer"
        },
        {
            "name": "cacert.pem",
            "in": "vendor/composer/ca-bundle"
        },
        {
            "name": "*.json",
            "in": "vendor/composer/spdx-licenses/res"
        }
    ],
    "compression": "GZ",
    "compactors": [
        "KevinGH\\Box\\Compactor\\Json",
        "KevinGH\\Box\\Compactor\\Php"
    ],
    "chmod": "0755",
    "algorithm": "SHA1"
}

{
    "name": "composer/satis",
    "description": "Simple Repository Generator",
    "keywords": [
        "package",
        "repository",
        "generator",
        "static",
        "composer"
    ],
    "homepage": "https://github.com/composer/satis",
    "type": "composer-plugin",
    "license": "MIT",
    "authors": [
        {
            "name": "Jordi Boggiano",
            "email": "j.boggiano@seld.be",
            "homepage": "https://seld.be"
        },
        {
            "name": "Nils Adermann",
            "email": "naderman@naderman.de",
            "homepage": "https://www.naderman.de"
        },
        {
            "name": "Rob Bast",
            "email": "rob.bast@gmail.com",
            "homepage": "https://robbast.nl"
        }
    ],
    "support": {
        "issues": "https://github.com/composer/satis",
        "source": "https://github.com/composer/satis",
        "forum": "https://gitter.com/composer/satis",
        "irc": "irc://freenode.net/composer"
    },
    "bin": [
        "bin/satis"
    ],
    "require": {
        "ext-zip": "*",
        "composer/composer": "^2.8.1",
        "composer-plugin-api": "^2.3.0",
        "symfony/console": "^7.1.5",
        "twig/twig": "^3.14.0",
        "twig/html-extra": "^3.13.0"
    },
    "autoload": {
        "psr-4": {
            "Composer\\Satis\\": "src"
        }
    },
    "require-dev": {
        "ext-json": "*",
        "mikey179/vfsstream": "^1.6.12",
        "phpunit/phpunit": "^9.6.21"
    },
    "autoload-dev": {
        "psr-4": {
            "Composer\\Satis\\": "tests"
        }
    },
    "extra": {
        "branch-alias": {
            "dev-main": "3.0-dev"
        },
        "class": "Composer\\Satis\\Plugin\\SatisPlugin"
    },
    "config": {
        "allow-plugins": {
            "composer/satis": true
        }
    },
    "scripts": {
        "test": "vendor/bin/phpunit",
        "phpstan": "tools/phpstan/vendor/bin/phpstan",
        "php-cs-fixer": "PHP_CS_FIXER_IGNORE_ENV=true tools/php-cs-fixer/vendor/bin/php-cs-fixer fix --dry-run --diff",
        "php-cs-fixer-fix": "PHP_CS_FIXER_IGNORE_ENV=true tools/php-cs-fixer/vendor/bin/php-cs-fixer fix"
    }
}

